== POV tag ==

This concerns POV tag cleanup.  Whenever an POV tag is placed, it is necessary to also post a message in the discussion section stating clearly why it is thought the article does not comply with POV guidelines, and suggestions for how to improve it.  This permits discussion and consensus among editors.  This is a drive-by tag, which is discouraged in WP, and it shall be removed. Future tags should have discussion posted as to why the tag was placed, and how the topic might be improved.  Better yet, edit the topic yourself with the improvements.  This statement is not a judgement of content, it is only a cleanup of frivolously and/or arbitrarily placed tags.  No discussion, no tag.[[User:Jjdon|Jjdon]] ([[User talk:Jjdon|talk]]) 22:01, 28 April 2008 (UTC)
